"original": |2-
     the "uri-security-supported" attribute is to indicate the security
     mechanisms (if any) used for each URI listed in
     "printer-uri-supported".  The purpose of the
     "uri-authentication-supported" attribute is to indicate the
     authentication mechanisms (if any) used for each URI listed in
     "printer-uri-supported".  These three attributes are fully described
     in Sections 5.4.1, 5.4.2, and 5.4.3.
"fixed": |-
  the "uri-security-supported" attribute is to indicate the security mechanisms (if any) used for each URI listed in "printer-uri-supported".  The purpose of the "uri-authentication-supported" attribute is to indicate the authentication mechanisms (if any) used for each URI listed in "printer-uri-supported".  These three attributes are fully described in Sections 5.4.1, 5.4.2, and 5.4.3.
"ko": |-
  "uri-security-supported" 속성은 "printer-uri-supported"에 나열된 각 URI에 사용되는 보안 메커니즘(있는 경우)을 나타냅니다. "uri-authentication-supported" 속성의 목적은 "printer-uri-supported"에 나열된 각 URI에 사용되는 인증 메커니즘(있는 경우)을 나타내는 것입니다. 이 세 가지 속성은 섹션 5.4.1, 5.4.2 및 5.4.3에 자세히 설명되어 있습니다.
